import React from'react';
import Logo from 'https://i.redd.it/rq36kl1xjxr01.png';

function Header() {
  return (
    <div className="Header">
      <div className="headerLeft">
        <img src={Logo} alt=""/>
        <h5>Reddit 2.0</h5>
      </div>
      <div className="headerRight">
        <a className="loginButton">Login</a>
      </div>
    </div>
  );
}

export default Header;
